import { PermissionGroup } from 'types/permissiongroup';

import './styles.css';

type Props = {
  permissionGroup: PermissionGroup[];
};

const PermissionGroupTable = ({ permissionGroup }: Props) => {
  const handleEdit = (code: string) => {
    // Lógica para editar o item com o código fornecido
    console.log(`Editar item com código ${code}`);
  };

  const handleDelete = (code: string) => {
    // Lógica para excluir o item com o código fornecido
    console.log(`Excluir item com código ${code}`);
  };

  return (
    <div className="permission-group-table-container">
      <table className="table table-striped permission-group-table">
        <thead>
          <tr className="permission-group-table-header">
            <th>Código</th>
            <th>Descrição</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {permissionGroup.map((permissionGroup) => (
            <tr key={permissionGroup.code}>
              <td>{permissionGroup.code}</td>
              <td>{permissionGroup.description}</td>
              <td>
                <button
                  className="btn btn-warning btn-sm"
                  onClick={() => handleEdit(permissionGroup.code)}
                >
                  Editar
                </button>
                <button
                  className="btn btn-danger btn-sm ml-2"
                  onClick={() => handleDelete(permissionGroup.code)}
                >
                  Excluir
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PermissionGroupTable;
